import React, { useState, useEffect } from 'react';
import './Navbar.css';

const Navbar = () => {
  const [isMenuOpen, setIsMenuOpen] = useState(false);
  const [scrolled, setScrolled] = useState(false);

  useEffect(() => {
    const handleScroll = () => {
      setScrolled(window.scrollY > 100);
    };

    window.addEventListener('scroll', handleScroll);
    return () => window.removeEventListener('scroll', handleScroll);
  }, []);

  const toggleMenu = () => {
    setIsMenuOpen(!isMenuOpen);
  };

  const closeMenu = () => {
    setIsMenuOpen(false);
  };

  const scrollToSection = (sectionId) => {
    const element = document.getElementById(sectionId);
    if (element) {
      element.scrollIntoView({ behavior: 'smooth' });
    }
    closeMenu();
  };

  return (
    <nav className={`navbar ${scrolled ? 'scrolled' : ''}`}>
      <div className="nav-container">
        <div className="nav-logo">
          <svg className="cactus-logo" width="40" height="40" viewBox="0 0 40 40" fill="none">
            <path d="M20 5C18 5 16.5 6.5 16.5 8.5C16.5 10.5 18 12 20 12C22 12 23.5 10.5 23.5 8.5C23.5 6.5 22 12 20 5Z" fill="var(--primary-color)"/>
            <path d="M20 12C18 12 16.5 13.5 16.5 15.5C16.5 17.5 18 19 20 19C22 19 23.5 17.5 23.5 15.5C23.5 13.5 22 19 20 12Z" fill="var(--primary-color)"/>
            <path d="M20 19C18 19 16.5 20.5 16.5 22.5C16.5 24.5 18 26 20 26C22 26 23.5 24.5 23.5 22.5C23.5 20.5 22 26 20 19Z" fill="var(--primary-color)"/>
            <path d="M20 26C18 26 16.5 27.5 16.5 29.5C16.5 31.5 18 33 20 33C22 33 23.5 31.5 23.5 29.5C23.5 27.5 22 33 20 26Z" fill="var(--primary-color)"/>
            <path d="M15 18C13 18 11.5 19.5 11.5 21.5C11.5 23.5 13 25 15 25C17 25 18.5 23.5 18.5 21.5C18.5 19.5 17 25 15 18Z" fill="var(--primary-color)"/>
            <path d="M25 18C23 18 21.5 19.5 21.5 21.5C21.5 23.5 23 25 25 25C27 25 28.5 23.5 28.5 21.5C28.5 19.5 27 25 25 18Z" fill="var(--primary-color)"/>
            <path d="M20 33C18 33 16.5 34.5 16.5 36.5C16.5 38.5 18 40 20 40C22 40 23.5 38.5 23.5 36.5C23.5 34.5 22 40 20 33Z" fill="var(--primary-color)"/>
          </svg>
          <span>CACTUS LABS AI</span>
        </div>

        <ul className={`nav-menu ${isMenuOpen ? 'active' : ''}`}>
          <li><button onClick={() => scrollToSection('home')}>Home</button></li>
          <li><button onClick={() => scrollToSection('services')}>Services</button></li>
          <li><button onClick={() => scrollToSection('about')}>About</button></li>
          <li><button onClick={() => scrollToSection('contact')}>Contact</button></li>
        </ul>

        <div className={`hamburger ${isMenuOpen ? 'active' : ''}`} onClick={toggleMenu}>
          <span></span>
          <span></span>
          <span></span>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
